import React from 'react';
import styled from 'styled-components';

import {
         BUTTON_TRANSPARENT,
         BUTTON_TRANSPARENT_D,
         BUTTON_TRANSPARENT_N
          } from '../../../Styles/Button'
         
const StyledDiv = styled.div`
  width: 60%;
  margin: 16px auto;
  border: 1px solid #eee;
  box-shadow: 0 2px 3px #ccc;
  padding: 16px;
  text-align: center;
  
  @media (min-width: 500px) {
    width: 450px;
  }
`;


const Soc = () => {
    

        return (
            <StyledDiv>
            <div >
                <h1 style={BUTTON_TRANSPARENT}> Social services </h1>
                <h3 style={BUTTON_TRANSPARENT_D}> 1 - Retirement </h3>
                <p style={BUTTON_TRANSPARENT_N}> 100.000 DZD  </p>
                <h3 style={BUTTON_TRANSPARENT_D}> 2 - Death  </h3>
                <p style={BUTTON_TRANSPARENT_N}>  Le décès du travailleur avant la retraite ( 100.000 DZD ) <br/>
                                                  Le décès à la retraite ( 50.000 DZD ) <br/>
                                                  Le décès d'un mari ou d'une femme ( 70.000 DZD ) <br/>
                                                  Le décès du fils ( 70.000 DZD ) <br/>
                                                  Le décès du père ( 40.000 DZD )  </p>
                <h3 style={BUTTON_TRANSPARENT_D}> 3 - Marriage  </h3>
                <p style={BUTTON_TRANSPARENT_N}> 20.000 DZD  </p>
                <h3 style={BUTTON_TRANSPARENT_D}> 4 - New born  </h3>
                <p style={BUTTON_TRANSPARENT_N}> 10.000 DZD  </p>
                <h3 style={BUTTON_TRANSPARENT_D}> 5 - Circumcision  </h3>
                <p style={BUTTON_TRANSPARENT_N}>  5.000 DZD </p>
                
            </div>
            </StyledDiv>
            )
        }
  

export default Soc ;
